import 'dart:convert';

class HeaderCategory {
	String? id;
	String? categoryName;
	String? imageUrl;

	HeaderCategory({this.id, this.categoryName, this.imageUrl});

	factory HeaderCategory.(Map<String, dynamic> data) {
		return HeaderCategory(
			id: data['id'] as String?,
			categoryName: data['category-name'] as String?,
			imageUrl: data['image-Url'] as String?,
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'category-name': categoryName,
			'image-Url': imageUrl,		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [HeaderCategory].
	factory HeaderCategory.fromJson(String data) {
		return HeaderCategory.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [HeaderCategory] to a JSON string.
	String toJson() => json.encode(());
}
